// Libs
import axios from 'axios';

const cors = 'https://cors-anywhere.herokuapp.com';
export const API_URL = 'https://github.com/akabab/superhero-api/tree/0.3.0/api';


export const getAllHeros = () => axios({
  url: `${API_URL}/all.json`,
  method: 'get',
  headers: {
    'Content-Type': 'application/json',
    'Access-Control-Allow-Origin': '*',
	},
});
